exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefWrappedRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://yt-zhongcheng.com/book/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/id="list"[^>]*>/,"</dl>").subLastIndexOf("</dt>"),recordRegex:hrefWrappedRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};